import './App.css';

const App = () => {

  const openIOH = (e) => {
      e.preventDefault();
      window.location.href('https://in-our-hands.com/');
  }

  return (
    <div className="container">
        <h1> Hello World! </h1>
        <h2> We are travelling by car back from the farm.</h2>
        <button onClick={openIOH}></button>
    </div>
  )
}

export default App;
